import React from "react";

const NavBarIcon = () => {
    return (
        <svg width="35" height="28" viewBox="0 0 35 28" fill="none" xmlns="http://www.w3.org/2000/svg">
        <rect width="35" height="6" rx="3" fill="#D9D9D9"/>
        <rect y="11" width="35" height="6" rx="3" fill="#D9D9D9"/>
        <rect y="22" width="35" height="6" rx="3" fill="#D9D9D9"/>
        </svg>
    );
};

export default { NavBarIcon };
